import ContactUs from '../components/MainPgComponents/Contact/contactUs'
import Footer from '../components/MainPgComponents/Footer/footer'

function Contact() {
  return (
    <div>
      <ContactUs />
      <Footer />
    </div>
  );
}

export default Contact;
